export default function Card(props) {
  function handleClick() {
    props.onCardClick(props.card);
  }

  return (
    <div key={props.key} className="element">
      <button key={props.key} className="element__delete-button" type="button" aria-label="удалить карточку"></button>
      <div
        key={props.key}
        className="element__image"
        onClick={handleClick}
        style={{ backgroundImage: `url(${props.link})` }}
        alt=""
      ></div>
      <div key={props.key} className="element-place">
        <h2 key={props.key} className="element-place__name">
          {props.name}
        </h2>
        <div key={props.key} className="element-place__like">
          <button key={props.key} className="element-place__like-button" type="button" aria-label="нравится"></button>
          <p key={props.key} className="element-place__like-counter">
            0
          </p>
        </div>
      </div>
    </div>
  );
}
